import React from 'react';
import Header from './Header';
import PersonalInfo from './PersonalInfo';
import Projects from './Projects';
import Courses from './Courses';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className='main-page-container'>
      <h1 className="Title">Hi,</h1>
        <h1 className="Title">I'm Jerry,</h1>
        <h1 className="Title">Student @UChicago</h1>
        <p className="Intro">I'm a third year undergrad majoring in Computer Science, Math, and Statistics. So far, I've tried to explore anything that's tech heavy, from software engineering, data science, machine learning, to algorithmic trading. My goal is to become a skilled tech person and contribute to the tech community, in any way possible.</p>
        <div className="Links">
          <a href="https://github.com/yourusername" target="_blank" rel="noopener noreferrer">GitHub</a>
          <a href="https://www.linkedin.com/in/yourusername/" target="_blank" rel="noopener noreferrer">LinkedIn</a>
          <a href="https://twitter.com/yourusername" target="_blank" rel="noopener noreferrer">Twitter</a>
        </div>
      </div>
      {/* <Header />
      <PersonalInfo />
      <Projects />
      <Courses /> */}
    </div>
  );
}

export default App;
